import React from "react";
import ContactForm from "./ContactForm"

export default function Footer () {
    return (
        <div className= "contactform">
            <h2>Contact</h2>
            <p>Mary Clayton</p>
        <p>mary.cathlean@gmail.com</p>
         <ContactForm className="contact" to="mary.cathlean@gmail.com" />
        </div>
    )
}
